import React from "react";
import "./TodoItems.css";
const TodoItems = (props) => {
  const { items } = props;

  return (
    <div>
      {items.map((item) => {
        return (
          <div key={item.id}>
            <span>{item.name} </span>
            <span>{item.age} </span>
            <span>&times;</span>
          </div>
        );
      })}
    </div>
  );
};

export default TodoItems;
